#include <iostream>int main(){    int n, m, a, b;    std::cin >> n >> m >> a >> b;    bool flg = true;;    int i = 0;    for(; i < m; ++i){        if(n < 0){            flg = false;            break;        }        if(n <= a){            n += b;        }         int c;        std::cin >> c;        n -= c;    }    if(flg){        std::cout << "complete" << std::endl;    }else{        std::cout << i << std::endl;    }        return 0;}